import React, { useEffect, useState } from "react";
import axios from "axios";
function PersonList() {
  const [person, setperson] = useState([]);
  useEffect(() => {
    axios
      .get("http://127.0.0.1:8000/api/person/")
      .then((res) => setperson(res.data));
  }, []);

  return (
    <div>
      <ul>
        {person.map((item) => (
          <li>{item.name}</li>
        ))}
      </ul>
    </div>
  );
}

export default PersonList;
